def bead_sort(arr):
    if all([type(x) == int and x >= 0 for x in arr]):
        ref = [range(x) for x in arr]
    else:
        raise ValueError("All Elements must be positive integers")
    
    inter = []
    ind = 0
    prev = sum([1 for x in ref if len(x) > ind])
    while prev:
        inter.append(range(prev))
        ind += 1
        prev = sum([1 for x in ref if len(x) > ind])
    ind = 0
    prev = sum([1 for x in inter if len(x) > ind])
    out = []
    while prev:
        out.append(prev)
        ind += 1
        prev = sum([1 for x in inter if len(x) > ind])
    
    out = out[::-1]
    return out


